const toPdf = async () => {
    /********************************
     *         STYLE OPTIONS        *
     ********************************/
    const styleOptions: SassOptions = {
        // Get relative path from cwd to the desired file
        file: path.resolve(__dirname, 'style.scss'),
    };

    /********************************
     *      TEMPLATE FILE PATH      *
     ********************************/
        // Get relative path from cwd to the desired file
    const htmlTemplatePath = path.resolve(__dirname, 'index.pug');

    /********************************
     *        TEMPLATE OPTIONS      *
     ********************************/
    const htmlTemplateOptions: pug.LocalsObject = { data };

    /********************************
     *        PDF FILE OPTIONS      *
     ********************************/
    const src = 'data:image/png;base64,';
    const pdfOptions: PDFOptions = {
        // Output path will be relative
        path: path.resolve(__dirname, 'output', 'dam.pdf'),
        format: 'A4',
        displayHeaderFooter: true,
        headerTemplate: `<div style="font-size:30px;color:red"><img width="120" src="${src}" /></div>`,
        printBackground: true,
        margin: { top: '90', bottom: '40' },
        footerTemplate: '<h1>Test Footer</h1>'
    };

    /********************************
     *      PUTTING IT TOGETHER     *
     ********************************/
    const teaSchoolOptions: TeaSchool.GeneratePdfOptions = {
        styleOptions,
        htmlTemplatePath,
        htmlTemplateOptions,
        pdfOptions,
    };

    /**************************************************************
     *      GENERATED PDF AS A FILE AND ALSO SAVED TO A FILE      *
     **************************************************************/
    const pdfFile = await TeaSchool.generatePdf(teaSchoolOptions);
    return pdfFile;
};
